import React from "react";
import Link from "next/link";

import { Menu, Button } from "antd";
import { ReadOutlined, BarsOutlined, SmileOutlined } from "@ant-design/icons";
const { SubMenu } = Menu;

const Nav = ({ categories }) => {
  return (
    <Menu mode="horizontal">
      <Menu.Item key="home" icon={<ReadOutlined />}>
        <Link href="/">
          <a>Home</a>
        </Link>
      </Menu.Item>
      <Menu.Item key="about" icon={<SmileOutlined />}>
        <Link href="/about">
          <a>About</a>
        </Link>
      </Menu.Item>
      <SubMenu key="SubMenu" icon={<BarsOutlined />} title="Categories">
        {categories.map((category) => {
          return (
            // <li key={category.id}>
            <Menu.Item key={category.id}>
              <Link as={`/category/${category.id}`} href="/category/[id]">
                <a>{category.name}</a>
              </Link>
            </Menu.Item>
          );
        })}
      </SubMenu>
    </Menu>
  );
};

export default Nav;
